//Navbar on the top of the page
class NavBar extends Component{

    render(){

    return(
        <div>
            <div>
            <AppBar position="static">
                <Toolbar>
                    <Typography variant ="subtitle1" color="inherit">
                       Product-Item Cart
                    </Typography>
                </Toolbar> 
            </AppBar>


        </div>
        </div>
    )
}
}

export default NavBar;
